import React, { useState, Memo } from 'react'
import  { Box, Stack } from '@mui/material'
import { Dropdown } from './Dropdown';
import { GeneDropdown } from './GeneDropdown';


const genes = [ 'BRCA1', 
    'BRCA2',
    'GEMS', 
    'XYZ'
]

export const Graph = () => {
    const [genes, setGenes] = useState<string[]>([])

    const handleGeneChange = (selection: string[]) => {
        console.log('handleGeneChange', selection)
        setGenes(selection)
    }

    return (
        <>        <Box 
            sx={{
                backgroundColor: 'primary.main',
                color: 'white',
                height: '200px',
                width: '120px',
                paddig: '16px',
                '&:hover': {
                    backgroundColor: 'primary.light'
                }
            }}
        >
            TEST
            <Dropdown label='Genes' options={genes} /> 
        </Box>
        <Stack direction='row-reverse' my={1}>
            <Box sx={{width: '250px'}}>
                <Memo>
                    <GeneDropdown onChange={handleGeneChange}/>
                </Memo>
            </Box>            
            <Box 
                sx={{
                  display: 'flex',
                  flexGrow: 1,
                  backgroundColor: 'secondary.main',
                  color: 'white',
                  paddig: '16px',
                  '&:hover': {
                    backgroundColor: 'secondary.light'
                  }
                }}
            >GRAPH <p>{genes}</p></Box>
        </Stack>
    </>

    )

}
